function App() {
  const expenses = [
    {
      title: 'Car Insurance',
      amount: 298.9,
      date: new Date(2022, 11, 25),
    },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem />
    </div>
  );
}

export default App;
